const newTweet  = async (req, res) => {
    try {
        var id = uuidv1();
        req.body.tweetId = id;
        var requestBody = await requestParameterValidation.newTweetParameter(req.body);
        console.log(requestBody);
        var response = await authService.insertTweetService(requestBody);
        var newRequestBody = await requestParameterValidation.validateLoginParmeters({"usernameOrEmail" : req.body.username })
        var userResponse = await  authService.loginUserService(newRequestBody);
        newRequestBody[0].value = userResponse[0].Id;
        var tweetListResponse = await await authService.tweetListService(newRequestBody);
        var tweets = []
        tweetListResponse.forEach(tweet => tweets.push(tweet.TweetId));
        var resultSet = {
            "likedUsers": [],
            "replies": [],
            "retweeters": [],
            "author": {
                "following": [],
                "followers": [],
                "likedTweets": [],
                "bookmarks": [],
                "__v": 4,
                "bio": ""
            },
            "__v": 0
        }
        var date = new Date().toString()
        resultSet["_id"] = id;
        resultSet["text"] = req.body.text;
        resultSet["createdDate"] = date;
        resultSet.author["_id"] = userResponse[0].Id;
        resultSet.author["name"] = userResponse[0].Name;
        resultSet.author["username"] = userResponse[0].UserName;
        resultSet.author["password"] = userResponse[0].Password;
        resultSet.author["joinedDate"] = date;
        resultSet.author["bannerImage"] = userResponse[0].BannerImage;
        resultSet.author["profileImage"] = userResponse[0].ProfileImage;
        resultSet.author["mail"] = userResponse[0].Email;
        resultSet.author["website"] = userResponse[0].WebSite;
        resultSet.author["location"] = userResponse[0].Location;
        resultSet.author["tweets"] = tweets;        
        res.set('Access-Control-Expose-Headers', '*');
        res.status(200);
        res.send(resultSet);
        }
    catch (error) {
            res.status(403);
            var message = { message: error };
            res.send(message);
        }
        }
        
